Nav nevienas parādāmas kontaktpersonas.

Lai pievienotu kontaktpersonas, pieskarieties vienumam Izvēlne, pēc tam pieskarieties vienumam:

Konti, lai pievienotu vai iestatītu ar tālruni sinhronizējamu kontu, kurā ir kontaktpersonas;

Jauna kontaktpersona, lai izveidotu jaunu kontaktpersonu, neizmantojot esošus datus;

Importēt/eksportēt, lai importētu kontaktpersonas no %s kartes vai SD kartes.

